import React, { useContext, createContext } from 'react';
import {
  useHistory,
  useLocation
} from 'react-router-dom';
import {
  Container,
  TextField
} from '@material-ui/core';

import { StyledButton, TitleText } from './StyledComponents';
import { useAuth } from './utils';


export default function Login() {
  let history = useHistory();
  let location = useLocation();
  let auth = useAuth();

  let { from } = location.state || { from: { pathname: "/" } };
  let login = () => {
    auth.signin(() => {
      console.log('go to page');
      history.replace(from);
    });
  };

  return (
    <Container style={{width:'30%'}}>
      <TitleText>Please log in to continue:</TitleText>
      <form>
        <TextField
          fullWidth={true}
          label="Username"
          style={{marginTop:'1rem'}}
          variant="outlined"/>
        <br/>
        <TextField
          fullWidth={true}
          label="Password"
          style={{marginTop:'1rem'}}
          variant="outlined"/>
      </form>
      <StyledButton
        onClick={login}
        variant='outlined'
        style={{background:'#F25278', fontColor:'white'}}>Log in</StyledButton>
    </Container>
  );
};
